import React, {Component} from "react";
import "./App.css";
import PageTreeData from "./page-tree/data.js";
import Page from "./components/page.js";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      pageList: []
    }
  }
  render() {
    return (
      <div className="App">
        <Page pages={this.state.pageList}/>
        <ul>
          <li>a</li>
          <li>b</li>
            <ul>
              <li>1</li>
              <li>2</li>
            </ul>
          <li>c</li>
        </ul>
      </div>
    );
  }

  componentDidMount() {
    PageTreeData().then(result => {
        this.setState({'pageList': result});
      });
  }
}

export default App;
